// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity 0.8.4;

import { MirrorEditions } from "./MirrorEditions.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "hardhat/console.sol";

contract EditionsMultipurchase2 is Ownable {

    function purchase(address editionAddress, uint256 editionId) external payable onlyOwner {
        MirrorEditions mirror = MirrorEditions(editionAddress);
        mirror.buyEdition{value: msg.value}(editionId);
    }

    function multipurchase(address editionAddress, uint256 editionId, uint256 count) external payable onlyOwner {
        console.log("msg.sender", msg.sender);
        console.log("msg.value", msg.value);
        console.log("multipurchase starting balance", address(this).balance);

        MirrorEditions mirror = MirrorEditions(editionAddress);

        uint256 quantity;
        uint256 price;
        address fundingRecipient;
        uint256 numSold;
        (quantity, price, fundingRecipient, numSold) = mirror.editions(editionId);
        console.log("quantity", quantity);
        console.log("price", price);
        console.log("fundingRecipient", fundingRecipient);
        console.log("numSold", numSold);

        for (uint i = 0; i < count; i++) {
            console.log("buying...", i);
            mirror.buyEdition{value: price}(editionId);
        }

        console.log("multipurchase ending balance", address(this).balance);
    }

}

